static void pmc_gic_proxy_reset(DeviceState *dev)
{
    PMCGICProxy *s = XILINX_PMC_GIC_PROXY(dev);
    unsigned int i;

    for (i = 0; i < ARRAY_SIZE(s->regs_info); ++i) {
        dep_register_reset(&s->regs_info[i]);
    }

    gicp0_irq_update_irq(s);
    gicp1_irq_update_irq(s);
    gicp2_irq_update_irq(s);
    gicp3_irq_update_irq(s);
    gicp4_irq_update_irq(s);
    gicp5_irq_update_irq(s);
    gicp6_irq_update_irq(s);
    gicp7_irq_update_irq(s);
    gicp_pmc_irq_update_irq(s);
}

static uint64_t pmc_gic_proxy_read(void *opaque, hwaddr addr, unsigned size)
{
    PMCGICProxy *s = XILINX_PMC_GIC_PROXY(opaque);
    DepRegisterInfo *r = &s->regs_info[addr / 4];

    if (!r->data) {
        qemu_log("%s: Decode error: read from %" HWADDR_PRIx "\n",
                 object_get_canonical_path(OBJECT(s)),
                 addr);
        return 0;
    }
    return dep_register_read(r);
}

static void pmc_gic_proxy_write(void *opaque, hwaddr addr, uint64_t value,
                      unsigned size)
{
    PMCGICProxy *s = XILINX_PMC_GIC_PROXY(opaque);
    DepRegisterInfo *r = &s->regs_info[addr / 4];

    if (!r->data) {
        qemu_log("%s: Decode error: write to %" HWADDR_PRIx "=%" PRIx64 "\n",
                 object_get_canonical_path(OBJECT(s)),
                 addr, value);
        return;
    }
    dep_register_write(r, value, ~0);
}

static const MemoryRegionOps pmc_gic_proxy_ops = {
    .read = pmc_gic_proxy_read,
    .write = pmc_gic_proxy_write,
    .endianness = DEVICE_LITTLE_ENDIAN,
    .valid = {
        .min_access_size = 4,
        .max_access_size = 4,
    },
};

static void pmc_gic_proxy_realize(DeviceState *dev, Error **errp)
{
    PMCGICProxy *s = XILINX_PMC_GIC_PROXY(dev);
    const char *prefix = object_get_canonical_path(OBJECT(dev));
    unsigned int i;

    for (i = 0; i < ARRAY_SIZE(pmc_gic_proxy_regs_info); ++i) {
        DepRegisterInfo *r;

        r = &s->regs_info[pmc_gic_proxy_regs_info[i].decode.addr / 4];
        *r = (DepRegisterInfo) {
            .data = (uint8_t *)&s->regs[
                    pmc_gic_proxy_regs_info[i].decode.addr / 4],
            .data_size = sizeof(uint32_t),
            .access = &pmc_gic_proxy_regs_info[i],
            .debug = XILINX_PMC_GIC_PROXY_ERR_DEBUG,
            .prefix = prefix,
            .opaque = s,
        };
    }
}

static void pmc_gic_proxy_init(Object *obj)
{
    PMCGICProxy *s = XILINX_PMC_GIC_PROXY(obj);
    SysBusDevice *sbd = SYS_BUS_DEVICE(obj);

    memory_region_init_io(&s->iomem, obj, &pmc_gic_proxy_ops, s,
                          TYPE_XILINX_PMC_GIC_PROXY, R_MAX * 4);
    sysbus_init_mmio(sbd, &s->iomem);

    sysbus_init_irq(sbd, &s->irq_gicp_pmc_irq);
    sysbus_init_irq(sbd, &s->irq_gicp0_irq);
    sysbus_init_irq(sbd, &s->irq_gicp1_irq);
    sysbus_init_irq(sbd, &s->irq_gicp2_irq);
    sysbus_init_irq(sbd, &s->irq_gicp3_irq);
    sysbus_init_irq(sbd, &s->irq_gicp4_irq);
    sysbus_init_irq(sbd, &s->irq_gicp5_irq);
    sysbus_init_irq(sbd, &s->irq_gicp6_irq);
    sysbus_init_irq(sbd, &s->irq_gicp7_irq);
}

