static void pmc_gic_proxy_class_init(ObjectClass *klass, void *data)
{
    DeviceClass *dc = DEVICE_CLASS(klass);

    dc->reset = pmc_gic_proxy_reset;
    dc->realize = pmc_gic_proxy_realize;
    dc->vmsd = &vmstate_pmc_gic_proxy;
}

